import React from 'react';
import './Header.css'; // Importing the CSS file for styles

const Header = () => {
  return (
    <header className="header">
      {/* Logo */}
      <div className="logo">
        <img src="/images/IMG-20241206-WA0001 (1).jpg" alt="Doctro Logo" /> 
      </div>

      {/* Navigation */}
      <nav className="nav-links">
        <ul>
          <li><a href="#services">Our Services</a></li>
          <li><a href="#about">About Us</a></li>
        </ul>
      </nav>

      {/* Login & Sign Up */}
      <div className="auth-buttons">
        <button className="btn">Doctor Login</button>
        <button className="btn">Patient Login</button>
        <button className="btn">Doctor Sign Up</button>
        <button className="btn">Patient Sign Up</button>
      </div>
    </header>
  );
};

export default Header;
